import { Typography } from '@material-ui/core';
import React from 'react';
import backgroundPic from '../../../Logo/healthy-diet.jpg'


export default class HomeContainer extends React.Component {
    render(){
        
        return (
            <div style={{marginTop:'60px',width:'100%'}}>
            <div style={{ backgroundImage:`url(${backgroundPic})`,height:'80vh',backgroundRepeat:'no-repeat',backgroundSize: '100%',marginRight:'0px',
                        display:'flex',justifyContent:'center', alignItems:'center'}}>
            <Typography   variant="h5" style={{color:'orange',breakAfter:'always'}} >Koга исхраната е исправна од медицината нема потреба</Typography>
            <Typography  variant="h5" style={{color:'orange',display:'block'}}>Заедно креираме здрави навики</Typography>
            </div> 
            </div>
        )}
}
